import React from "react";

const SignUp = (props) => {
  return (
    <>
      <h2>회원가입</h2>
      <form className="form" action="index.html">
        <label>이메일</label>
        <input id="email" type="email" placeholder="이메일"></input>
        <input type="button" value="중복확인"></input>
      </form>
    </>
  );
};

export default SignUp;
